import{o as p,c,a,b as n,u as l}from"./index-cd9b39de.js";const o="/assets/discord_notification-3a10be8b.png";const t={class:"md-content__inner md-typeset"},e=["src"],r={__name:"WebhookConfig",setup(i){return(u,s)=>(p(),c("article",t,[s[0]||(s[0]=a(`<h1 id="webhook-usage"> Webhook 사용법 <a class="headerlink" href="#webhook-usage" title="영구 링크"> ¶ </a></h1><h2 id="configuration"> 설정 <a class="headerlink" href="#configuration" title="영구 링크"> ¶ </a></h2><p> 구성 파일에 webhook 섹션을 추가하고 <code> webhook.enabled </code> 를 <code> true </code> 로 설정하여 Webhook을 활성화하세요. </p><p>샘플 구성 (IFTTT를 사용하여 테스트됨).</p><div class="highlight"><pre><code><span class="w">  </span><span class="nt">&quot;webhook&quot;</span><span class="p">:</span><span class="w"> </span><span class="p">{</span>
<span class="w">        </span><span class="nt">&quot;enabled&quot;</span><span class="p">:</span><span class="w"> </span><span class="kc">true</span><span class="p">,</span>
<span class="w">        </span><span class="nt">&quot;url&quot;</span><span class="p">:</span><span class="w"> </span><span class="s2">&quot;https://maker.ifttt.com/trigger/&lt;YOUREVENT&gt;/with/key/&lt;YOURKEY&gt;/&quot;</span><span class="p">,</span>
<span class="w">        </span><span class="nt">&quot;entry&quot;</span><span class="p">:</span><span class="w"> </span><span class="p">{</span>
<span class="w">            </span><span class="nt">&quot;value1&quot;</span><span class="p">:</span><span class="w"> </span><span class="s2">&quot;Buying {pair}&quot;</span><span class="p">,</span>
<span class="w">            </span><span class="nt">&quot;value2&quot;</span><span class="p">:</span><span class="w"> </span><span class="s2">&quot;limit {limit:8f}&quot;</span><span class="p">,</span>
<span class="w">            </span><span class="nt">&quot;value3&quot;</span><span class="p">:</span><span class="w"> </span><span class="s2">&quot;{stake_amount:8f} {stake_currency}&quot;</span>
<span class="w">        </span><span class="p">},</span>
<span class="w">        </span><span class="nt">&quot;entry_cancel&quot;</span><span class="p">:</span><span class="w"> </span><span class="p">{</span>
<span class="w">            </span><span class="nt">&quot;value1&quot;</span><span class="p">:</span><span class="w"> </span><span class="s2">&quot;Cancelling Open Buy Order for {pair}&quot;</span><span class="p">,</span>
<span class="w">            </span><span class="nt">&quot;value2&quot;</span><span class="p">:</span><span class="w"> </span><span class="s2">&quot;limit {limit:8f}&quot;</span><span class="p">,</span>
<span class="w">            </span><span class="nt">&quot;value3&quot;</span><span class="p">:</span><span class="w"> </span><span class="s2">&quot;{stake_amount:8f} {stake_currency}&quot;</span>
<span class="w">        </span><span class="p">},</span>
<span class="w">         </span><span class="nt">&quot;entry_fill&quot;</span><span class="p">:</span><span class="w"> </span><span class="p">{</span>
<span class="w">            </span><span class="nt">&quot;value1&quot;</span><span class="p">:</span><span class="w"> </span><span class="s2">&quot;Buy Order for {pair} filled&quot;</span><span class="p">,</span>
<span class="w">            </span><span class="nt">&quot;value2&quot;</span><span class="p">:</span><span class="w"> </span><span class="s2">&quot;at {open_rate:8f}&quot;</span><span class="p">,</span>
<span class="w">            </span><span class="nt">&quot;value3&quot;</span><span class="p">:</span><span class="w"> </span><span class="s2">&quot;&quot;</span>
<span class="w">        </span><span class="p">},</span>
<span class="w">        </span><span class="nt">&quot;exit&quot;</span><span class="p">:</span><span class="w"> </span><span class="p">{</span>
<span class="w">            </span><span class="nt">&quot;value1&quot;</span><span class="p">:</span><span class="w"> </span><span class="s2">&quot;Exiting {pair}&quot;</span><span class="p">,</span>
<span class="w">            </span><span class="nt">&quot;value2&quot;</span><span class="p">:</span><span class="w"> </span><span class="s2">&quot;limit {limit:8f}&quot;</span><span class="p">,</span>
<span class="w">            </span><span class="nt">&quot;value3&quot;</span><span class="p">:</span><span class="w"> </span><span class="s2">&quot;profit: {profit_amount:8f} {stake_currency} ({profit_ratio})&quot;</span>
<span class="w">        </span><span class="p">},</span>
<span class="w">        </span><span class="nt">&quot;exit_cancel&quot;</span><span class="p">:</span><span class="w"> </span><span class="p">{</span>
<span class="w">            </span><span class="nt">&quot;value1&quot;</span><span class="p">:</span><span class="w"> </span><span class="s2">&quot;Cancelling Open Exit Order for {pair}&quot;</span><span class="p">,</span>
<span class="w">            </span><span class="nt">&quot;value2&quot;</span><span class="p">:</span><span class="w"> </span><span class="s2">&quot;limit {limit:8f}&quot;</span><span class="p">,</span>
<span class="w">            </span><span class="nt">&quot;value3&quot;</span><span class="p">:</span><span class="w"> </span><span class="s2">&quot;profit: {profit_amount:8f} {stake_currency} ({profit_ratio})&quot;</span>
<span class="w">        </span><span class="p">},</span>
<span class="w">        </span><span class="nt">&quot;exit_fill&quot;</span><span class="p">:</span><span class="w"> </span><span class="p">{</span>
<span class="w">            </span><span class="nt">&quot;value1&quot;</span><span class="p">:</span><span class="w"> </span><span class="s2">&quot;Exit Order for {pair} filled&quot;</span><span class="p">,</span>
<span class="w">            </span><span class="nt">&quot;value2&quot;</span><span class="p">:</span><span class="w"> </span><span class="s2">&quot;at {close_rate:8f}.&quot;</span><span class="p">,</span>
<span class="w">            </span><span class="nt">&quot;value3&quot;</span><span class="p">:</span><span class="w"> </span><span class="s2">&quot;&quot;</span>
<span class="w">        </span><span class="p">},</span>
<span class="w">        </span><span class="nt">&quot;status&quot;</span><span class="p">:</span><span class="w"> </span><span class="p">{</span>
<span class="w">            </span><span class="nt">&quot;value1&quot;</span><span class="p">:</span><span class="w"> </span><span class="s2">&quot;Status: {status}&quot;</span><span class="p">,</span>
<span class="w">            </span><span class="nt">&quot;value2&quot;</span><span class="p">:</span><span class="w"> </span><span class="s2">&quot;&quot;</span><span class="p">,</span>
<span class="w">            </span><span class="nt">&quot;value3&quot;</span><span class="p">:</span><span class="w"> </span><span class="s2">&quot;&quot;</span>
<span class="w">        </span><span class="p">}</span>
<span class="w">    </span><span class="p">},</span>
</code></pre></div><p><code> webhook.url </code> 의 URL은 Webhook에 대한 올바른 URL을 가리켜야 합니다. IFTTT를 사용하는 경우 (위 샘플 참조) 이벤트와 키를 URL에 삽입하세요. </p><p> POST 본문 형식을 Form-Encoded(기본값), JSON-Encoded 또는 raw 데이터로 설정할 수 있습니다. 각각 <code> &quot;format&quot;: &quot;form&quot; </code> , <code> &quot;format&quot;: &quot;json&quot; </code> 또는 <code> &quot;format&quot;: &quot;raw&quot; </code> 를 사용하세요. Mattermost Cloud 통합 예제 구성: </p><div class="highlight"><pre><code><span class="w">  </span><span class="nt">&quot;webhook&quot;</span><span class="p">:</span><span class="w"> </span><span class="p">{</span>
<span class="w">        </span><span class="nt">&quot;enabled&quot;</span><span class="p">:</span><span class="w"> </span><span class="kc">true</span><span class="p">,</span>
<span class="w">        </span><span class="nt">&quot;url&quot;</span><span class="p">:</span><span class="w"> </span><span class="s2">&quot;https://&lt;YOURSUBDOMAIN&gt;.cloud.mattermost.com/hooks/&lt;YOURHOOK&gt;&quot;</span><span class="p">,</span>
<span class="w">        </span><span class="nt">&quot;format&quot;</span><span class="p">:</span><span class="w"> </span><span class="s2">&quot;json&quot;</span><span class="p">,</span>
<span class="w">        </span><span class="nt">&quot;status&quot;</span><span class="p">:</span><span class="w"> </span><span class="p">{</span>
<span class="w">            </span><span class="nt">&quot;text&quot;</span><span class="p">:</span><span class="w"> </span><span class="s2">&quot;Status: {status}&quot;</span>
<span class="w">        </span><span class="p">}</span>
<span class="w">    </span><span class="p">},</span>
</code></pre></div><p> 결과는 예를 들어 <code> {&quot;text&quot;:&quot;Status: running&quot;} </code> 본문과 <code> Content-Type: application/json </code> 헤더를 포함한 POST 요청이 되며, Mattermost 채널에 <code> Status: running </code> 메시지가 표시됩니다. </p><p> Form-Encoded 또는 JSON-Encoded 구성을 사용할 때는 원하는 만큼의 페이로드 값을 구성할 수 있으며, 키와 값 모두 POST 요청에 출력됩니다. 그러나 raw 데이터 형식을 사용할 때는 하나의 값만 구성할 수 있으며 <strong> 반드시 </strong><code> &quot;data&quot; </code> 로 명명되어야 합니다. 이 경우 데이터 키는 POST 요청에 출력되지 않고 값만 출력됩니다. 예: </p><div class="highlight"><pre><code><span class="w">  </span><span class="nt">&quot;webhook&quot;</span><span class="p">:</span><span class="w"> </span><span class="p">{</span>
<span class="w">        </span><span class="nt">&quot;enabled&quot;</span><span class="p">:</span><span class="w"> </span><span class="kc">true</span><span class="p">,</span>
<span class="w">        </span><span class="nt">&quot;url&quot;</span><span class="p">:</span><span class="w"> </span><span class="s2">&quot;https://&lt;YOURHOOKURL&gt;&quot;</span><span class="p">,</span>
<span class="w">        </span><span class="nt">&quot;format&quot;</span><span class="p">:</span><span class="w"> </span><span class="s2">&quot;raw&quot;</span><span class="p">,</span>
<span class="w">        </span><span class="nt">&quot;webhookstatus&quot;</span><span class="p">:</span><span class="w"> </span><span class="p">{</span>
<span class="w">            </span><span class="nt">&quot;data&quot;</span><span class="p">:</span><span class="w"> </span><span class="s2">&quot;Status: {status}&quot;</span>
<span class="w">        </span><span class="p">}</span>
<span class="w">    </span><span class="p">},</span>
</code></pre></div><p> 결과는 예를 들어 <code> Status: running </code> 본문과 <code> Content-Type: text/plain </code> 헤더를 포함한 POST 요청이 됩니다. </p><h2 id="additional-configurations"> 추가 설정 <a class="headerlink" href="#additional-configurations" title="영구 링크"> ¶ </a></h2><p><code> webhook.retries </code> 매개변수는 Webhook 요청이 실패했을 때 (예: HTTP 응답 상태가 200이 아님) 재시도할 최대 횟수를 설정할 수 있습니다. 기본값은 <code> 0 </code> 으로 비활성화되어 있습니다. 추가로 <code> webhook.retry_delay </code> 매개변수를 설정하여 재시도 간격(초)을 지정할 수 있습니다. 기본값은 <code> 0.1 </code> (즉, 100ms)입니다. 재시도 횟수나 지연 시간을 늘리면 Webhook 연결 문제 시 트레이더가 느려질 수 있습니다. 또한 <code> webhook.timeout </code> 을 지정하여 다른 호스트가 응답하지 않는 것으로 간주하기까지의 시간을 정의할 수 있습니다 (기본값은 10초). </p><p>재시도 예제 구성:</p><div class="highlight"><pre><code><span class="w">  </span><span class="nt">&quot;webhook&quot;</span><span class="p">:</span><span class="w"> </span><span class="p">{</span>
<span class="w">        </span><span class="nt">&quot;enabled&quot;</span><span class="p">:</span><span class="w"> </span><span class="kc">true</span><span class="p">,</span>
<span class="w">        </span><span class="nt">&quot;url&quot;</span><span class="p">:</span><span class="w"> </span><span class="s2">&quot;https://&lt;YOURHOOKURL&gt;&quot;</span><span class="p">,</span>
<span class="w">        </span><span class="nt">&quot;timeout&quot;</span><span class="p">:</span><span class="w"> </span><span class="mi">10</span><span class="p">,</span>
<span class="w">        </span><span class="nt">&quot;retries&quot;</span><span class="p">:</span><span class="w"> </span><span class="mi">3</span><span class="p">,</span>
<span class="w">        </span><span class="nt">&quot;retry_delay&quot;</span><span class="p">:</span><span class="w"> </span><span class="mf">0.2</span><span class="p">,</span>
<span class="w">        </span><span class="nt">&quot;status&quot;</span><span class="p">:</span><span class="w"> </span><span class="p">{</span>
<span class="w">            </span><span class="nt">&quot;status&quot;</span><span class="p">:</span><span class="w"> </span><span class="s2">&quot;Status: {status}&quot;</span>
<span class="w">        </span><span class="p">}</span>
<span class="w">    </span><span class="p">},</span>
</code></pre></div><p> 사용자 정의 메시지는 전략 내에서 <code> self.dp.send_msg() </code> 함수를 통해 Webhook 엔드포인트로 보낼 수 있습니다. 이를 활성화하려면 <code> allow_custom_messages </code> 옵션을 <code> true </code> 로 설정하세요: </p><div class="highlight"><pre><code><span class="w">  </span><span class="nt">&quot;webhook&quot;</span><span class="p">:</span><span class="w"> </span><span class="p">{</span>
<span class="w">        </span><span class="nt">&quot;enabled&quot;</span><span class="p">:</span><span class="w"> </span><span class="kc">true</span><span class="p">,</span>
<span class="w">        </span><span class="nt">&quot;url&quot;</span><span class="p">:</span><span class="w"> </span><span class="s2">&quot;https://&lt;YOURHOOKURL&gt;&quot;</span><span class="p">,</span>
<span class="w">        </span><span class="nt">&quot;allow_custom_messages&quot;</span><span class="p">:</span><span class="w"> </span><span class="kc">true</span><span class="p">,</span>
<span class="w">        </span><span class="nt">&quot;strategy_msg&quot;</span><span class="p">:</span><span class="w"> </span><span class="p">{</span>
<span class="w">            </span><span class="nt">&quot;status&quot;</span><span class="p">:</span><span class="w"> </span><span class="s2">&quot;StrategyMessage: {msg}&quot;</span>
<span class="w">        </span><span class="p">}</span>
<span class="w">    </span><span class="p">},</span>
</code></pre></div><p>다양한 이벤트에 대해 다른 페이로드를 구성할 수 있습니다. 모든 필드가 필수는 아니지만, 하나 이상의 딕셔너리를 구성해야 Webhook이 호출됩니다.</p><h2 id="webhook-message-types"> Webhook 메시지 유형 <a class="headerlink" href="#webhook-message-types" title="영구 링크"> ¶ </a></h2><h3 id="entry"> 진입 <a class="headerlink" href="#entry" title="영구 링크"> ¶ </a></h3><p><code> webhook.entry </code> 의 필드는 봇이 롱/숏을 실행할 때 채워집니다. 매개변수는 string.format을 사용하여 채워집니다. 가능한 매개변수는 다음과 같습니다: </p><ul><li><code> trade_id </code></li><li><code> exchange </code></li><li><code> pair </code></li><li><code> direction </code></li><li><code> leverage </code></li><li><del><code> limit </code> # 더 이상 사용되지 않음. </del></li><li><code> open_rate </code></li><li><code> amount </code></li><li><code> open_date </code></li><li><code> stake_amount </code></li><li><code> stake_currency </code></li><li><code> base_currency </code></li><li><code> quote_currency </code></li><li><code> fiat_currency </code></li><li><code> order_type </code></li><li><code> current_rate </code></li><li><code> enter_tag </code></li></ul><h3 id="entry-cancel"> 진입 취소 <a class="headerlink" href="#entry-cancel" title="영구 링크"> ¶ </a></h3><p><code> webhook.entry_cancel </code> 의 필드는 봇이 롱/숏 주문을 취소할 때 채워집니다. 매개변수는 string.format을 사용하여 채워집니다. 가능한 매개변수는 다음과 같습니다: </p><ul><li><code> trade_id </code></li><li><code> exchange </code></li><li><code> pair </code></li><li><code> direction </code></li><li><code> leverage </code></li><li><code> limit </code></li><li><code> amount </code></li><li><code> open_date </code></li><li><code> stake_amount </code></li><li><code> stake_currency </code></li><li><code> base_currency </code></li><li><code> quote_currency </code></li><li><code> fiat_currency </code></li><li><code> order_type </code></li><li><code> current_rate </code></li><li><code> enter_tag </code></li></ul><h3 id="entry-fill"> 진입 완료 <a class="headerlink" href="#entry-fill" title="영구 링크"> ¶ </a></h3><p><code> webhook.entry_fill </code> 의 필드는 봇이 롱/숏 주문을 완료할 때 채워집니다. 매개변수는 string.format을 사용하여 채워집니다. 가능한 매개변수는 다음과 같습니다: </p><ul><li><code> trade_id </code></li><li><code> exchange </code></li><li><code> pair </code></li><li><code> direction </code></li><li><code> leverage </code></li><li><code> open_rate </code></li><li><code> amount </code></li><li><code> open_date </code></li><li><code> stake_amount </code></li><li><code> stake_currency </code></li><li><code> base_currency </code></li><li><code> quote_currency </code></li><li><code> fiat_currency </code></li><li><code> order_type </code></li><li><code> current_rate </code></li><li><code> enter_tag </code></li></ul><h3 id="exit"> 종료 <a class="headerlink" href="#exit" title="영구 링크"> ¶ </a></h3><p><code> webhook.exit </code> 의 필드는 봇이 거래를 종료할 때 채워집니다. 매개변수는 string.format을 사용하여 채워집니다. 가능한 매개변수는 다음과 같습니다: </p><ul><li><code> trade_id </code></li><li><code> exchange </code></li><li><code> pair </code></li><li><code> direction </code></li><li><code> leverage </code></li><li><code> gain </code></li><li><code> limit </code></li><li><code> amount </code></li><li><code> open_rate </code></li><li><code> profit_amount </code></li><li><code> profit_ratio </code></li><li><code> stake_currency </code></li><li><code> base_currency </code></li><li><code> quote_currency </code></li><li><code> fiat_currency </code></li><li><code> exit_reason </code></li><li><code> order_type </code></li><li><code> open_date </code></li><li><code> close_date </code></li></ul><h3 id="exit-fill"> 종료 완료 <a class="headerlink" href="#exit-fill" title="영구 링크"> ¶ </a></h3><p><code> webhook.exit_fill </code> 의 필드는 봇이 종료 주문을 완료할 때 (거래를 종료할 때) 채워집니다. 매개변수는 string.format을 사용하여 채워집니다. 가능한 매개변수는 다음과 같습니다: </p><ul><li><code> trade_id </code></li><li><code> exchange </code></li><li><code> pair </code></li><li><code> direction </code></li><li><code> leverage </code></li><li><code> gain </code></li><li><code> close_rate </code></li><li><code> amount </code></li><li><code> open_rate </code></li><li><code> current_rate </code></li><li><code> profit_amount </code></li><li><code> profit_ratio </code></li><li><code> stake_currency </code></li><li><code> base_currency </code></li><li><code> quote_currency </code></li><li><code> fiat_currency </code></li><li><code> exit_reason </code></li><li><code> order_type </code></li><li><code> open_date </code></li><li><code> close_date </code></li></ul><h3 id="exit-cancel"> 종료 취소 <a class="headerlink" href="#exit-cancel" title="영구 링크"> ¶ </a></h3><p><code> webhook.exit_cancel </code> 의 필드는 봇이 종료 주문을 취소할 때 채워집니다. 매개변수는 string.format을 사용하여 채워집니다. 가능한 매개변수는 다음과 같습니다: </p><ul><li><code> trade_id </code></li><li><code> exchange </code></li><li><code> pair </code></li><li><code> direction </code></li><li><code> leverage </code></li><li><code> gain </code></li><li><code> limit </code></li><li><code> amount </code></li><li><code> open_rate </code></li><li><code> current_rate </code></li><li><code> profit_amount </code></li><li><code> profit_ratio </code></li><li><code> stake_currency </code></li><li><code> base_currency </code></li><li><code> quote_currency </code></li><li><code> fiat_currency </code></li><li><code> exit_reason </code></li><li><code> order_type </code></li><li><code> open_date </code></li><li><code> close_date </code></li></ul><h3 id="status"> 상태 <a class="headerlink" href="#status" title="영구 링크"> ¶ </a></h3><p><code> webhook.status </code> 의 필드는 정기적인 상태 메시지 (시작됨 / 중지됨 / ...)에 사용됩니다. 매개변수는 string.format을 사용하여 채워집니다. </p><p> 여기서 가능한 유일한 값은 <code> {status} </code> 입니다. </p><h2 id="discord"> Discord <a class="headerlink" href="#discord" title="영구 링크"> ¶ </a></h2><p>특별한 형태의 Webhook이 Discord에 사용할 수 있습니다. 다음과 같이 구성할 수 있습니다:</p><div class="highlight"><pre><code><span class="nt">&quot;discord&quot;</span><span class="p">:</span><span class="w"> </span><span class="p">{</span>
<span class="w">    </span><span class="nt">&quot;enabled&quot;</span><span class="p">:</span><span class="w"> </span><span class="kc">true</span><span class="p">,</span>
<span class="w">    </span><span class="nt">&quot;webhook_url&quot;</span><span class="p">:</span><span class="w"> </span><span class="s2">&quot;https://discord.com/api/webhooks/&lt;Your webhook URL ...&gt;&quot;</span><span class="p">,</span>
<span class="w">    </span><span class="nt">&quot;exit_fill&quot;</span><span class="p">:</span><span class="w"> </span><span class="p">[</span>
<span class="w">        </span><span class="p">{</span><span class="nt">&quot;Trade ID&quot;</span><span class="p">:</span><span class="w"> </span><span class="s2">&quot;{trade_id}&quot;</span><span class="p">},</span>
<span class="w">        </span><span class="p">{</span><span class="nt">&quot;Exchange&quot;</span><span class="p">:</span><span class="w"> </span><span class="s2">&quot;{exchange}&quot;</span><span class="p">},</span>
<span class="w">        </span><span class="p">{</span><span class="nt">&quot;Pair&quot;</span><span class="p">:</span><span class="w"> </span><span class="s2">&quot;{pair}&quot;</span><span class="p">},</span>
<span class="w">        </span><span class="p">{</span><span class="nt">&quot;Direction&quot;</span><span class="p">:</span><span class="w"> </span><span class="s2">&quot;{direction}&quot;</span><span class="p">},</span>
<span class="w">        </span><span class="p">{</span><span class="nt">&quot;Open rate&quot;</span><span class="p">:</span><span class="w"> </span><span class="s2">&quot;{open_rate}&quot;</span><span class="p">},</span>
<span class="w">        </span><span class="p">{</span><span class="nt">&quot;Close rate&quot;</span><span class="p">:</span><span class="w"> </span><span class="s2">&quot;{close_rate}&quot;</span><span class="p">},</span>
<span class="w">        </span><span class="p">{</span><span class="nt">&quot;Amount&quot;</span><span class="p">:</span><span class="w"> </span><span class="s2">&quot;{amount}&quot;</span><span class="p">},</span>
<span class="w">        </span><span class="p">{</span><span class="nt">&quot;Open date&quot;</span><span class="p">:</span><span class="w"> </span><span class="s2">&quot;{open_date:%Y-%m-%d %H:%M:%S}&quot;</span><span class="p">},</span>
<span class="w">        </span><span class="p">{</span><span class="nt">&quot;Close date&quot;</span><span class="p">:</span><span class="w"> </span><span class="s2">&quot;{close_date:%Y-%m-%d %H:%M:%S}&quot;</span><span class="p">},</span>
<span class="w">        </span><span class="p">{</span><span class="nt">&quot;Profit&quot;</span><span class="p">:</span><span class="w"> </span><span class="s2">&quot;{profit_amount} {stake_currency}&quot;</span><span class="p">},</span>
<span class="w">        </span><span class="p">{</span><span class="nt">&quot;Profitability&quot;</span><span class="p">:</span><span class="w"> </span><span class="s2">&quot;{profit_ratio:.2%}&quot;</span><span class="p">},</span>
<span class="w">        </span><span class="p">{</span><span class="nt">&quot;Enter tag&quot;</span><span class="p">:</span><span class="w"> </span><span class="s2">&quot;{enter_tag}&quot;</span><span class="p">},</span>
<span class="w">        </span><span class="p">{</span><span class="nt">&quot;Exit Reason&quot;</span><span class="p">:</span><span class="w"> </span><span class="s2">&quot;{exit_reason}&quot;</span><span class="p">},</span>
<span class="w">        </span><span class="p">{</span><span class="nt">&quot;Strategy&quot;</span><span class="p">:</span><span class="w"> </span><span class="s2">&quot;{strategy}&quot;</span><span class="p">},</span>
<span class="w">        </span><span class="p">{</span><span class="nt">&quot;Timeframe&quot;</span><span class="p">:</span><span class="w"> </span><span class="s2">&quot;{timeframe}&quot;</span><span class="p">},</span>
<span class="w">    </span><span class="p">],</span>
<span class="w">    </span><span class="nt">&quot;entry_fill&quot;</span><span class="p">:</span><span class="w"> </span><span class="p">[</span>
<span class="w">        </span><span class="p">{</span><span class="nt">&quot;Trade ID&quot;</span><span class="p">:</span><span class="w"> </span><span class="s2">&quot;{trade_id}&quot;</span><span class="p">},</span>
<span class="w">        </span><span class="p">{</span><span class="nt">&quot;Exchange&quot;</span><span class="p">:</span><span class="w"> </span><span class="s2">&quot;{exchange}&quot;</span><span class="p">},</span>
<span class="w">        </span><span class="p">{</span><span class="nt">&quot;Pair&quot;</span><span class="p">:</span><span class="w"> </span><span class="s2">&quot;{pair}&quot;</span><span class="p">},</span>
<span class="w">        </span><span class="p">{</span><span class="nt">&quot;Direction&quot;</span><span class="p">:</span><span class="w"> </span><span class="s2">&quot;{direction}&quot;</span><span class="p">},</span>
<span class="w">        </span><span class="p">{</span><span class="nt">&quot;Open rate&quot;</span><span class="p">:</span><span class="w"> </span><span class="s2">&quot;{open_rate}&quot;</span><span class="p">},</span>
<span class="w">        </span><span class="p">{</span><span class="nt">&quot;Amount&quot;</span><span class="p">:</span><span class="w"> </span><span class="s2">&quot;{amount}&quot;</span><span class="p">},</span>
<span class="w">        </span><span class="p">{</span><span class="nt">&quot;Open date&quot;</span><span class="p">:</span><span class="w"> </span><span class="s2">&quot;{open_date:%Y-%m-%d %H:%M:%S}&quot;</span><span class="p">},</span>
<span class="w">        </span><span class="p">{</span><span class="nt">&quot;Enter tag&quot;</span><span class="p">:</span><span class="w"> </span><span class="s2">&quot;{enter_tag}&quot;</span><span class="p">},</span>
<span class="w">        </span><span class="p">{</span><span class="nt">&quot;Strategy&quot;</span><span class="p">:</span><span class="w"> </span><span class="s2">&quot;{strategy} {timeframe}&quot;</span><span class="p">},</span>
<span class="w">    </span><span class="p">]</span>
<span class="p">}</span>
</code></pre></div><p> 위는 기본값을 나타냅니다 ( <code> exit_fill </code> 과 <code> entry_fill </code> 은 선택 사항이며 위 구성으로 기본 설정됩니다) - 수정이 가능합니다. 두 기본값 ( <code> entry_fill </code> / <code> exit_fill </code> )을 비활성화하려면 빈 배열을 할당할 수 있습니다 ( <code> exit_fill: [] </code> ). </p><p>사용 가능한 필드는 Webhook의 필드에 해당하며 해당 Webhook 섹션에 문서화되어 있습니다.</p><p>알림은 기본적으로 다음과 같이 표시됩니다.</p>`,47)),n("p",null,[n("img",{alt:"discord-notification",src:l(o)},null,8,e)]),s[1]||(s[1]=a(`<p> 사용자 정의 메시지는 전략에서 dataprovider.send_msg() 함수를 통해 Discord 엔드포인트로 보낼 수 있습니다. 이를 활성화하려면 <code> allow_custom_messages </code> 옵션을 <code> true </code> 로 설정하세요: </p><div class="highlight"><pre><code><span class="w">  </span><span class="nt">&quot;discord&quot;</span><span class="p">:</span><span class="w"> </span><span class="p">{</span>
<span class="w">        </span><span class="nt">&quot;enabled&quot;</span><span class="p">:</span><span class="w"> </span><span class="kc">true</span><span class="p">,</span>
<span class="w">        </span><span class="nt">&quot;webhook_url&quot;</span><span class="p">:</span><span class="w"> </span><span class="s2">&quot;https://discord.com/api/webhooks/&lt;Your webhook URL ...&gt;&quot;</span><span class="p">,</span>
<span class="w">        </span><span class="nt">&quot;allow_custom_messages&quot;</span><span class="p">:</span><span class="w"> </span><span class="kc">true</span><span class="p">,</span>
<span class="w">    </span><span class="p">},</span>
</code></pre></div>`,2))]))}};export{r as default};
